            </h2>
            <button type="submit" class="w-auto text-white bgColor hover:bg-gray-800 focus:ring-4 focus:outline-none focus:ring-gray-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bgColor dark:hover:bg-gray-700 dark:focus:ring-gray-800">Get directions</button>


        </div>

        </div>
</div>

</template>

